INSERT INTO `item` VALUES (77,'availble','msi','The peak of gaming is here. The Titan GT77 HX is like a nuclear fusion core that can generate continual graphics & processor energy. This Titan transmits massive output and is a galactic innovation unlike anything before.','3%',13500,'[\"https://www.nanotek.lk/uploads/product/1136-20230222113059-1024%20(1)%20(2).png\"]','i7',35,'8GB','14inch','256GB',450000,'Titan GT77 HX'),(78,'availble','Asus','On the move, work more. Powerful Windows 10 Home gaming is housed in superslim chassis with the brand-new TUF Dash F15.The newest 11th Gen Intel Core i5 -12450H CPU and GeForce RTX 3050 GPU enable smooth gaming on displays that can refresh at up to a blistering 144Hz.','2.5%',11000,'[\"https://www.nanotek.lk/uploads/product/1923-20230131121625-FX517%20(1).png\"]','i7',12,'12GB','14inch','256GB',440000,'Asus Tuf Dash F15 Fx517Zc – i5 Gaming'),(79,'availble','Lenovo','Purpose-built for gaming performance, the Lenovo Legion 5 is the perfect platform for experiencing today\'s top AAA games. Inside the clean, minimalist chassis of this gaming laptop, you\'ll find a powerful AMD Ryzen 7 5800H processor and NVIDIA® GeForce RTX™ 3050Ti graphics, along with 16GB DDR4 RAM and 512GB NVMe SSD storage. Performance is optimized by the Legion AI Engine, powering the revolutionary Legion Coldfront 3.0 and Q Control. The 15.6-inch full HD IPS display performs at up to 165Hz refresh rate with <3 ms response time and features 100% sRGB color accuracy – along with support for Dolby Vision® and AMD FreeSync™ Premium. You\'ll also enjoy 2 x 2W speakers with the new Nahimic 3D audio for gamers.','1.8%',10602,'[\"https://www.nanotek.lk/uploads/product/1613-20221217091747Lenovo_Legion_5_15ACH6H_CT1_02%20(1).png\"]','Ryzen 7',7,'12GB','15.6inch','512GB',589000,'Lenovo Legion 5 Gaming Laptop'),(80,'availble','Asus','ROG Back pack, ROG Impact Gaming Mouse – 1080P@60FPS External Camera . Buy the ASUS ROG Strix SCAR 15 G533QR-HF009T RTX 3070 Gaming Laptop 13.6','2.2%',10978,'[\"https://www.nanotek.lk/uploads/product/969-20230131114928-h732%20(11).png\"]','i7',20,'8GB','13.6inch','256GB',499000,'ASUS ROG Scar 15 G533QS (R9)'),(81,'available','Lenovo','IdeaPad is a line of consumer-oriented laptop computers designed, developed and marketed by Lenovo.','1.3%',3770,'[\"https://m.media-amazon.com/images/I/61Dw5Z8LzJL._SL1000_.jpg\"]','i3',14,'4GB','15.6inch','128GB',290000,'Lenovo IdeaPad 3 '),(82,'available','hp','HP most popular laptop brand in the world. HP 255 G8 Notebook laptop run with windows 11 home version. This laptop used AMD Ryzen  3 3250U, RAM 8 GB, 256 GB PCIe® NVMe™ M.2 SSD, and AMD Radeon™ Graphics card.','2.1%',6594,'[\"https://unitysystems.lk/pub/media/catalog/product/cache/9d6c5e1739f5d32a2e9bca805f06d25b/h/p/h255-g8-15-inch-fhd-ryzen-3-5300u-laptop-sri-lanka-price-3_1.jpg\"]','Ryzen 3',25,'4GB','13.6inch','128GB',314000,'LAPTOP HP 255-G8'),(83,'available','hp','HP 15s-du3527TU Laptop comes with Intel Core i5-1135G7 Processor (8M Cache, 2.40 GHz up to 4.20 GHz), 8GB DDR4 2666 (2 x 4GB) RAM, 1TB 5400RPM SATA HDD and 15.6″ FHD (1920 x 1080) IPS Display. This Laptop is featured Intel Iris Graphics, 3-cell, 41 Wh Li-ion battery, HP True Vision 720p HD camera with integrated dual array digital microphones, 65 W Smart AC power adapter, Dual speakers.','2.2%',6534,'[\"https://cdn.shopify.com/s/files/1/0512/4793/9793/products/hp-core-i5-laptop-silver-8gb-1tbips-15-6-fhd-win-11-ms-office1.jpg?v=1675227729\"]','i5',18,'4GB','12.6inch','128GB',297000,'HP 15s-du3527TU'),(84,'available','Dell','The Dell Inspiron 14 2-in-1 has been one of the more popular 2-in-1 options, especially if you’re hoping to save a few hundred bucks compared to the most premium laptops. And Dell has updated the machine for 2022 with a slightly more streamlined aesthetic and an upgrade to Intel’s 12th-gen CPUs.','3.1%',12059,'[\"https://i.dell.com/is/image/DellContent/content/dam/ss2/product-images/dellclientproducts/notebooks/inspiron-notebooks/14-7420-2n1/media-gallery/notebook-inspiron-14-74202-in-1-right-gallery-4.psd?fmt=pngalpha&pscan=auto&scl=1&hei=402&wid=556&qlt=100,1&resMode=sharp2&size=556,402&chrss=full\"]','i5',22,'8GB','14.6inch','256GB',389000,'inspiron-14-74202');
